/**
 *[getEnCountry 获取中文对应的国家英文名字]
 * @return {'name'} []
 */
export function getEnCountry(name) {
  let _name = ''
  data.forEach(item => {
    if (name === item.cn) {
      _name = item.en
    } else if (name === item.en) {
      _name = item.en
    }
  })
  return _name
}

/**
 *[getEnCountry 获取英文对应的国家中文名字]
 * @return {'name'} []
 */
export function getCnCountry(name) {
  let _name = ''
  data.forEach(item => {
    if (name === item.en) {
      _name = item.cn
    } else if (name === item.cn) {
      _name = item.cn
    }
  })
  return _name
}

/**
 *[getEnCountry 获取国家的坐标]
 * @return {'name'} []
 */
export function getCoord(name) {
  let _coord = []
  data.forEach(item => {
    if (name === item.en) {
      _coord = item.cp
    } else if (name === item.cn) {
      _coord = item.cp
    }
  })
  return _coord
}

/**
 *[getEnCountry 世界地图映射]
 * @return {'name'} []
 */

 export function mapName() {
   let obj = {}
   data.forEach(item => {
    obj[item.en] = item.cn
   })
   return obj
 }
